const Filter = () => {
    const fruits = ["jeruk", "matoa", "durian", "alpokat"];
    const fruit2 = fruits.filter((fl) => fl <= [3]);
  
    return (
      <>

        <ul>{fruit2}</ul>
      </>
    );
  };
  
  export default Filter;
